import React from "react";
import styles from "./Home.module.css";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className={styles.card}>
      <div className={styles.headingWrapper}>
        <img src="./images/logo.png" alt="logo" />
        <h1 classsname={styles.heading}>Welcome to LiveSanchar !</h1>
      </div>
      <p>
        We're working hard to get Livesanchar ready for everyone! While we wrap
        up the finishing youches, we're adding people gradually to make sure
        nothing breaks
      </p>
      <div>
        <button>
          <span>Get your username</span>
          <img src="./images/arrow-forward.png" alt="arrow" />
        </button>
      </div>
      <div>
        <span>Have an invite text?</span>
        <Link to="/login">Sign In</Link>
      </div>
    </div>
  );
};

export default Home;
